import React from "react";
import TopLogo from "./TopLogo"
import Footer from "./Footer";
import SearchBar from "./SearchBar";
import MealItemsList from "./MealItemsList";

import topLogo from "../images/BackgroundFood.png"
import mealImage from "../images/Burger_Fries.png"

const OrderPage = () => {
  return(
    <div className="page-container">
      <TopLogo displayImage={topLogo}/>
      <SearchBar />
      <MealItemsList imageTitles={imageTitles}/>
      <Footer />
    </div>
  );
}

const imageTitles = [
  {
    title: "Meals",
    image: mealImage,
    url: "/meals"
  },
  {
    title: "Sides",
    image: mealImage,
    url: "/meals"
  },
  {
    title: "Drinks",
    image: mealImage,
    url: "/meals"
  },
  {
    title: "Desserts",
    image: mealImage,
    url: "/meals"
  }
];

export default OrderPage;
